import { List, Header } from "semantic-ui-react";

const Stations = ({stations}) => {
    return ( 
        <List>
            {stations.map(station => {
                return(
                    <List.Item key={station.name}>
                        <Header>{station.title}</Header>
                    </List.Item>
                );
    	    })}
        </List>
     );
}
 
export default Stations;
